	Đầu ti&ecirc;n BQT xin cảm ơn sự ủng hộ nhiệt t&igrave;nh của c&aacute;c anh chị em trong thời gian qua. Tuy mới chạy test được một tuần nhưng BQT đ&atilde; nhận được rất nhiều g&oacute;p &yacute; v&agrave; cả những t&acirc;m tư của c&aacute;c anh chị em về một game V&otilde; L&acirc;m chất lượng. Những điều n&agrave;y l&agrave;m ch&uacute;ng t&ocirc;i cảm thấy c&oacute; động lực rất nhiều để ra một game đ&uacute;ng chất cho c&aacute;c anh em.</p>

