	Nhằm mục ti&ecirc;u thu h&uacute;t th&ecirc;m người chơi cho server đ&ocirc;ng vui khi mở v&agrave; chuẩn bị server&nbsp;<span class="text_exposed_show" style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">kĩ hơn về mọi mặt, BQT xin th&ocirc;ng b&aacute;o dời ng&agrave;y&nbsp;<span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bolder; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Open ch&iacute;nh thức game sang 19h&nbsp;ng&agrave;y 23/12/2017.</span></span></p>

